import React from 'react';
import PropTypes from 'prop-types';

const Book = ({ id }) => {
  return (
    <div>
      <h1>Book / {id}</h1>
    </div>
  );
};

Book.propTypes = {
  id: PropTypes.string.isRequired,
};

Book.getInitialProps = async context => {
  const id = context.query.id;
  return { id };
};

export default Book;
